INSERT INTO `posts` VALUES ('01569337-3476-4b49-8abb-d781f2c721a5','Mặt Bằng Văn phòng, Lê Văn Quới, Bình Tân.','0','ONAH','Địa chỉ: Đường Lê Văn Quới, Phường Bình Trị Đông A, Quận Bình Tân, Hồ Chí Minh','ceb210bf-54c6-4b7d-9003-ee2da6c259ba','CTMB','1E1N','CUID','3U-D','[\"- Mặt bằng tầng trệt 36m² . Lối đi riêng không chung chủ.\",\"- Vị trí đắc địa, mặt tiền đường Lê Văn Quới rộng 20m phương tiện đi lại thoải mái, thích hợp mở văn phòng công ty, đại lý vé máy bay, quầy thuốc, shop quần áo, mỹ phẩm, tiệm nail, spa, phun xăm, mỹ phẩm,..\",\"- Tiện ích xung quanh mặt bằng đầy đủ: gần chợ Lê Văn Quới, trường học mầm non, THCS, THPT, ĐH Văn Hiến, ĐH Hồng Bàng, ngân hàng ACB, SCB, Techcombank, cách siêu thị BHX, xung quanh nhiều văn phòng công ty tiện lợi cho các loại hình kinh doanh. Giao thông đi lại thuận tiện khu vực trung tâm.\",\"- Khu vực an ninh tốt, khu dân cư đông đúc, kinh doanh buôn bán sầm uất.\",\"- Hợp đồng cho thuê dài hạn.\",\"- Thanh toán từng tháng.\",\"- Giá thuê: 13 triệu/tháng, cọc 3 tháng.\",\"Còn thương lượng và hỗ trợ\",\"Gọi ngay để trao đổi và xem mặt bằng văn phòng\"]','7e9dbbdb-8131-4120-8061-4ba00e0b0cf7','a114aba7-56ba-4385-98bd-7ca8683eb844','3db82375-8a5f-43de-97dd-c9691260f406','2023-03-27 12:55:18','2023-03-27 12:55:18'),('0356d92f-c2d2-48c8-ad49-d7a518171bbb','Cần cho thuê mặt bằng Mặt tiền : 7m Diện tích 180m2 x3 tầng tại Hà Nội','0','OAAĐ','Địa chỉ: Phố Xốm, Phường Phú Lãm, Quận Hà Đông, Hà Nội','48946b74-f7c8-4d6d-9ed0-28d7c88134d9','CTMB','EU5N','NDOE','EN9E','[\"MẶT BẰNG SIÊU ĐẸP - PHÙ HỢP KINH DOANH MỌI NGÀNH NGHỀ, NẰM Ở TRUNG TÂM THÀNH PHỐ BÌNH DƯƠNG SẦM UẤT và NÁO NHIỆTTTTT\",\"Phố Xốm, Phú Lãm, Hà Đông, Hà Nội\",\"Mặt tiền : 7m\",\"Diện tích : 180m2 x3 tầng\",\"Gía thuê: Tầng 1/40tr/1 tháng\"]','1a1e33a0-0c2f-41ba-8217-ba3dd03238a0','a486fedb-1686-4797-b1f2-6e7db5dd8756','0800f7f5-ad45-48e1-9074-2fcdc073ade3','2023-03-27 12:55:18','2023-03-27 12:55:18'),('044d104a-7c59-468a-a327-73d42e70e83b','Cho thuê CHDV phòng trọ giá rẽ 